    );

    const exampleDispatch = useDispatch();

    const example1 = () => {
        exampleDispatch(example_action);
    }
    const example2 = () => {
        exampleDispatch(example_action2);
    }

    return(
        <>  
            <h2>Redux Example</h2>
            <button onClick={() => example1()}>
                example 1
            </button>
            <button onClick={() => example2()}>
                example 2
            </button>
        </>
    );
}

